import React, { useEffect, useState } from 'react';
import Layout from '../components/layout';
import { getTopSongs } from '../services/spotifyapi';

const formatDuration = (seconds) => {
  const mins = Math.floor(seconds / 60);
  const secs = seconds % 60;
  return `${mins}:${secs.toString().padStart(2, '0')}`;
};

const TopSongs = () => {
  const [songs, setSongs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [usingFallback, setUsingFallback] = useState(false);

  useEffect(() => {
    const loadSongs = async () => {
      try {
        const topSongs = await getTopSongs();
        setSongs(topSongs);
        setUsingFallback(topSongs[0]?.preview === null); // Check if using fallback
      } catch (err) {
        console.error('Error loading songs:', err);
      } finally {
        setLoading(false);
      }
    };

    loadSongs();
  }, []);

  return (
    <Layout title="Top Songs" showNav={true}>
      <div style={styles.container}>
        {usingFallback && (
          <div style={styles.warning}>
            Note: Showing sample data as we couldn't connect to Spotify
          </div>
        )}

        <h2 style={styles.header}>Top Songs</h2>
        
        {loading ? (
          <div style={styles.loading}>
            <div style={styles.spinner}></div>
            <p>Loading top songs...</p>
          </div>
        ) : (
          <div style={styles.songList}>
            {songs.map(song => (
              <div key={song.id} style={styles.songCard}>
                <span style={styles.rank}>{song.rank}</span>
                <img 
                  src={song.cover} 
                  alt={`${song.title} cover`} 
                  style={styles.cover}
                  onError={(e) => e.target.src = 'https://via.placeholder.com/60'}
                />
                <div style={styles.info}>
                  <h3 style={styles.title}>{song.title}</h3>
                  <p style={styles.artist}>{song.artist}</p>
                </div>
                <span style={styles.time}>{formatDuration(song.duration)}</span>
                {song.preview && (
                  <audio controls style={styles.audio}>
                    <source src={song.preview} type="audio/mpeg" />
                  </audio>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </Layout>
  );
};

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px'
  },
  warning: {
    backgroundColor: '#ff9800',
    color: 'white',
    padding: '10px',
    borderRadius: '4px',
    marginBottom: '20px',
    textAlign: 'center'
  },
  header: {
    color: '#1DB954',
    marginBottom: '20px',
    textAlign: 'center'
  },
  loading: {
    textAlign: 'center',
    padding: '40px'
  },
  spinner: {
    border: '4px solid rgba(255,255,255,0.1)',
    borderTop: '4px solid #1DB954',
    borderRadius: '50%',
    width: '40px',
    height: '40px',
    animation: 'spin 1s linear infinite',
    margin: '0 auto 15px'
  },
  songList: {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px'
  },
  songCard: {
    display: 'flex',
    alignItems: 'center',
    padding: '10px',
    backgroundColor: 'rgba(255,255,255,0.05)',
    borderRadius: '8px',
    transition: 'all 0.3s',
    ':hover': {
      backgroundColor: 'rgba(255,255,255,0.1)'
    }
  },
  rank: {
    width: '30px',
    textAlign: 'center',
    fontWeight: 'bold',
    color: '#1DB954'
  },
  cover: {
    width: '50px',
    height: '50px',
    borderRadius: '4px',
    margin: '0 15px',
    objectFit: 'cover'
  },
  info: {
    flex: 1,
    minWidth: 0
  },
  title: {
    margin: 0,
    fontSize: '16px',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis'
  },
  artist: {
    margin: '5px 0 0',
    fontSize: '14px',
    color: 'rgba(255,255,255,0.7)'
  },
  time: {
    margin: '0 15px',
    color: 'rgba(255,255,255,0.5)'
  },
  audio: {
    width: '150px',
    height: '40px'
  }
};

export default TopSongs;
